import React, { useEffect, useState } from 'react';
import {useNavigate} from 'react-router-dom'

const Logout = () => {
    const navigate = useNavigate();

    useEffect(() => {

        fetch('/Logout')
            .then(res => res.json())
            .then(async (data) => {
                // await console.log(data)
                // console.log('done')
                navigate("/SignIn");
            })
    }, []);

  return (
    <div>
      <h1>your are logout successfully</h1>
    </div>
  )
}

export default Logout
